function Ships() {
  function dragStartHandler(e, ent) {
    console.log("dragstart ");
    console.dir(ent)
  }

  function dragEndHandler(e) {
    console.log("drag end");
  }

  function dragOverHandler(e) {
    console.log("drag over");
  }

  function dropHandler(e, ent) {
    console.log("drop");
    console.dir("drop")
  }

  function dragLeaveHandler(e) {
    console.log("drag leave");
  }

  return (
    <div
      className="ShipsContainer"
      style={{
        display: "grid",
        backgroundColor: "gray",
        width: "200px",
        height: "200px",
      }}
    >
      <div
        className="ship4"
        draggable
        onDragStart={(e) => dragStartHandler(e, { onDragStartt: "test" })}
        onDragLeave={(e) => dragLeaveHandler(e)}
        onDragEnd={(e) => dragEndHandler(e)}
        onDragOver={(e) => dragOverHandler(e)}
        onDrop={(e) => dropHandler(e, { onDropp: "test" })}
        style={{
          backgroundColor: "pink",
          width: `${20 * 4 - 4}px`,
          margin: "1px 1px",
          border: "solid 2px blue",
          height: "16px",
          cursor: "grab",
        }}
      ></div>
      <div
        className="ship3-1"
        draggable
        onDragStart={(e) => dragStartHandler(e, { onDragStartt: "test" })}
        onDragLeave={(e) => dragLeaveHandler(e)}
        onDragEnd={(e) => dragEndHandler(e)}
        onDragOver={(e) => dragOverHandler(e)}
        onDrop={(e) => dropHandler(e, { onDropp: "test" })}
        style={{
          backgroundColor: "pink",
          width: `${20 * 3 - 4}px`,
          margin: "1px 1px",
          border: "solid 2px blue",
          height: "16px",
          cursor: "grab",
        }}
      ></div>
    </div>
  );
}

export default Ships;
